import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";

class Counters extends Component {
  render() {
    return (
      <div>
        <nav
          style={{ background: "#0554a9", color: "#fff" }}
          className="navbar "
        >
          <p style={{ paddingTop: 10 }}>Count</p>
        </nav>
        <div className="row m-5">
          <button className="btn btn-counter btn-danger">-</button>
          <p style={{ marginLeft: 20, marginRight: 20, paddingTop: 5 }}>2</p>
          <button className="btn btn-counter btn-primary">+</button>
        </div>
      </div>
    );
  }
}

export default Counters;
